// src/pages/Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { FaUserCircle } from 'react-icons/fa';

const Dashboard = () => {
  const [articles, setArticles] = useState([]);
  const [videos, setVideos] = useState([]);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [username, setUsername] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      const token = localStorage.getItem('access');
      if (!token) {
        setIsLoggedIn(false);
        return;
      }
      try {
        const profileRes = await axios.get('http://localhost:8000/api/profile/', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setUsername(profileRes.data.username);
        setIsLoggedIn(true);

        const articleRes = await axios.get('http://localhost:8000/api/articles/', {
          headers: { Authorization: `Bearer ${token}` }
        });
        const videoRes = await axios.get('http://localhost:8000/api/videos/', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setArticles(articleRes.data);
        setVideos(videoRes.data);
      } catch (err) {
        setError('Gagal memuat data. Pastikan Anda sudah login.');
        setIsLoggedIn(false);
      }
    };

    fetchData();
  }, []);

  const handleLoginClick = () => {
    navigate('/login');
  };

  return (
    <div className="max-w-5xl mx-auto p-4">
      <div className="flex items-center justify-between mb-6">
        <h1 className="text-3xl font-bold">Selamat datang di CYCO</h1>
        {isLoggedIn ? (
          <div className="flex items-center gap-2">
            <FaUserCircle size={28} className="text-gray-700" />
            <span className="font-semibold text-gray-700">{username}</span>
          </div>
        ) : (
          <button
            onClick={handleLoginClick}
            className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
          >
            Login
          </button>
        )}
      </div>

      <p className="mb-6 text-gray-700">
        CYCO (Cyber Cognitive Learning) adalah platform pembelajaran yang menyediakan artikel dan video interaktif seputar dunia komputer dan teknologi. Silakan pilih menu yang Anda butuhkan.
      </p>

      <div className="flex flex-wrap gap-2 mb-8">
        <button onClick={() => navigate('/articles')} className="bg-blue-500 text-white px-4 py-2 rounded">Artikel</button>
        <button onClick={() => navigate('/videos')} className="bg-blue-500 text-white px-4 py-2 rounded">Video</button>
        <button onClick={() => navigate('/profile')} className="bg-blue-500 text-white px-4 py-2 rounded">Profil</button>
        <button onClick={() => navigate('/upload-article')} className="bg-blue-500 text-white px-4 py-2 rounded">Upload Artikel</button>
        <button onClick={() => navigate('/upload-video')} className="bg-blue-500 text-white px-4 py-2 rounded">Upload Video</button>
      </div>

      {error && <p className="text-red-600 mb-4">{error}</p>}

      <section className="mb-8">
        <h2 className="text-xl font-semibold mb-2">Artikel Terbaru</h2>
        {articles.length > 0 ? (
          <ul className="space-y-2">
            {articles.map((article) => (
              <li key={article.id} className="p-4 border rounded shadow">
                <h3 className="text-lg font-bold">{article.title}</h3>
                <p className="text-sm text-gray-600">{article.content}</p>
              </li>
            ))}
          </ul>
        ) : (
          <p>Tidak ada artikel.</p>
        )}
      </section>

      <section>
        <h2 className="text-xl font-semibold mb-2">Video Terbaru</h2>
        {videos.length > 0 ? (
          <ul className="space-y-2">
            {videos.map((video) => (
              <li key={video.id} className="p-4 border rounded shadow">
                <h3 className="text-lg font-bold">{video.title}</h3>
                <p className="text-sm text-gray-600">{video.description}</p>
                <a href={video.video_url} className="text-blue-600 underline" target="_blank" rel="noopener noreferrer">Lihat Video</a>
              </li>
            ))}
          </ul>
        ) : (
          <p>Tidak ada video.</p>
        )}
      </section>
    </div>
  );
};

export default Dashboard;
